function VotingItem() {
  return (
    <div>
        <img src="/img/abdulqadir.JPG" alt='c-img' className="c-img"/>
        <h1>Ali Raza</h1>
        <h1>Pakistan Tehreek-e-Insaf</h1>
        <button>Vote</button>
    </div>
  )
}

export default VotingItem
